import React, { useEffect } from 'react'
import IsoCertification from '../../Component/IsoCertification/IsoCertification'
import PageHeader from '../../Component/PageHeader/PageHeader'

export default function isoCertification(){

  
  useEffect(() => {
    window.scrollTo({
      top: 0,
      behavior: "smooth",
    });
  }, []);

  return (
    <>
    <PageHeader  topheading="Iso Certification" title="isocertification" />
    <IsoCertification/>
    </>
  )
}
